import React from 'react';
import matchData from '../Data/MatchData';

const MatchList = () => {
  return (
    <section className="p-4">
      <h2 className="text-xl font-bold mb-4">Ma√ß Listesi</h2>
      <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-4">
        {matchData.map((match) => (
          <div key={match.id} className="border p-4 flex items-center justify-between">
            <div className="flex items-center">
              <img src={match.team1.logo} alt={match.team1.name} className="w-8 h-8 mr-2" />
              <p>{match.team1.name}</p>
            </div>
            <p>{match.date}</p>
            <div className="flex items-center">
              <p>{match.team2.name}</p>
              <img src={match.team2.logo} alt={match.team2.name} className="w-8 h-8 ml-2" />
            </div>
          </div>
        ))}
      </div>
    </section>
  );
};

export default MatchList;
